import React from 'react';
import './App.css';
import Board from './game/Board'

interface Props {
}

interface State {
    val: number
}

class App extends React.Component<Props, State> {

    constructor(props: Props) {
        super(props);
        this.state = {
            val: 0
        }
    }

    componentDidMount() {
        import('wasm').then(module => {
            this.setState({val: module.add_ints(9, 9)})
        })
    }

    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <Board/>
                </header>
            </div>
        );
    }
}

export default App;
